                                    <p>၄. ထီလက်မှတ်သည် လူကြီးမင်းတို့ထံရောက်ရှိပြီးချိန်တွင် ထီလက်မှတ်ပျောက်ဆုံးခြင်းနှင့် တခြားနောက်ပိုင်းပြဿနာများအားဖြေရှင်းပေးမည်မဟုတ်ပါ။</p>
