                                    <p>၆. ထီဆုရသော လက်မှတ်တွင် အက္ခရာတစ်ဆက်တစ်စပ်တည်းမရှိ၊ ပိုင်းပြတ်စုတ်ပြတ်နေခြင်းနှင့် တခြားပြင်ရာ ဖျက်ရာ (သို့မဟုတ်) မူလအနေအထား ချွတ်ယွင်းပျက်စီးမူတွေ့ရှိပါက ဆုငွေထုတ်ပေးခြင်းကို သက်ဆိုင်ရာဌာနမှ ငြင်းပယ်ခွင့်ရှိပါသည်။</>
                                    <p>၇. ထီလက်မှတ်ဝယ်ယူထားကြောင်းအချက်အလက်ရှိသော်လည်း ထီလက်မှတ်တင်ပြနိုင်မှသာလျှင် ဆုငွေရထိုက်သူဟု အသိအမှတ်ပြုပေးပါမည်။</p>
                                    <p>၈. ဆုငွေရရှိသူ၊ ထီပေါက်သူသည် နိုင်ငံတော်သစ္စာဖောက်ဖျက်ပုန်ကန်ခြင်းနှင့် စပ်လျဉ်း၍ ပြစ်မူဆိုင်ရာဥပဒေပါ ပြစ်မူတစ်ခုခုကိ");
                WriteLiteral(@"ု ကျူးလွန်သည်ဟု အောင်ဘာလေသိန်းဆုဌာနခွဲညွှန်ကြာရေးမှူးကယုံကြည်ရန်အကြောင်းရှိလျှင် ဆုငွေထုတ်ပေးခြင်းကို ရပ်ဆိုင်းထားပိုင်ခွင်ရှိသည်။</p>
